import React, { useState } from 'react';
import ParkingArea from './ParkingArea';

const ParkingSpaces = ({ spaces, setSpaces, handleSave }) => {
  const [mode, setMode] = useState('add');

  return (
    <div>
      <h2>주차 공간 배치</h2>
      <div>
        <button onClick={() => setMode('add')}>추가 모드</button>
        <button onClick={() => setMode('delete')}>삭제 모드</button>
      </div>
      <ParkingArea mode={mode} spaces={spaces} setSpaces={setSpaces} />
      <button onClick={handleSave}>저장</button>
    </div>
  );
};

export default ParkingSpaces;
